import React from "react";
import Grid from "../UI/Grid/Grid";
import Project from "./Project";
const Projects = () => {
  return (
    <Grid>
      <Project order={1} title={"Threads"}  details={"Illustration"} />
      <Project order={2} title={"Explore"}  details={"Graphic Design"} />
      <Project order={3} title={"Finish"}  details={"Identity"} />
      <Project order={4} title={"Lines"}  details={"test"} />
      <Project order={5} title={"thread"}  details={"test"} />
      <Project order={6} title={"thread"}  details={"test"} />
    </Grid>
  );
};
export default Projects;
